CREATE SCHEMA som_01;

CREATE TABLE som_01.`FULL_PERSON` ( 
	`IAMID`              varchar(100)  NOT NULL    PRIMARY KEY,
	`ID`                 varchar(36)  NOT NULL    ,
	`FIRST_NAME`         varchar(240)      ,
	`MI`                 varchar(240)      ,
	`LAST_NAME`          varchar(240)  NOT NULL    ,
	`ACTIVITY_DATE`      datetime  NOT NULL    ,
	`EXTERNAL_USER`      varchar(120)      ,
	`UDC_ID`             varchar(100)      ,
	`BIRTH_DATE`         datetime      ,
	`EMAL_CODE`          varchar(16)      ,
	`EMAIL_ADDRESS`      varchar(512)      ,
	`PREFERRED_IND`      varchar(4)      
 );

CREATE TABLE som_01.`PERSON` ( 
	`IAMID`              varchar(100)  NOT NULL    PRIMARY KEY,
	`ID`                 varchar(36)  NOT NULL    ,
	`FIRST_NAME`         varchar(240)      ,
	`MI`                 varchar(240)      ,
	`LAST_NAME`          varchar(240)  NOT NULL    ,
	`ACTIVITY_DATE`      datetime  NOT NULL    ,
	CONSTRAINT `ID` UNIQUE ( `ID` ) 
 );

CREATE TABLE som_01.`PERSON2` ( 
	`IAMID`              varchar(100)  NOT NULL    ,
	`PREF_FIRST_NAME`    varchar(240)      ,
	`DEAD_IND`           varchar(4)      ,
	`BIRTH_DATE`         datetime      ,
	`NAME_SUFFIX`        varchar(80)      ,
	`ACTIVITY_DATE`      datetime  NOT NULL    ,
	CONSTRAINT `IAMID` UNIQUE ( `IAMID` ) ,
	CONSTRAINT person2_ibfk_1 FOREIGN KEY ( `IAMID` ) REFERENCES som_01.`PERSON`( `IAMID` ) ON DELETE RESTRICT ON UPDATE RESTRICT
 );

CREATE TABLE som_01.`UDCID` ( 
	`IAMID`              varchar(100)  NOT NULL    ,
	`UDC_ID`             varchar(100)  NOT NULL    ,
	`ACTIVITY_DATE`      datetime  NOT NULL    ,
	CONSTRAINT udcid_ibfk_1 FOREIGN KEY ( `IAMID` ) REFERENCES som_01.`PERSON`( `IAMID` ) ON DELETE RESTRICT ON UPDATE RESTRICT
 );

CREATE INDEX `IAMID` ON som_01.`UDCID` ( `IAMID` );

CREATE TABLE som_01.`BANNERUSERNAME` ( 
	`IAMID`              varchar(100)  NOT NULL    ,
	`EXTERNAL_USER`      varchar(120)      ,
	`ACTIVITY_DATE`      datetime  NOT NULL    ,
	CONSTRAINT bannerusername_ibfk_1 FOREIGN KEY ( `IAMID` ) REFERENCES som_01.`PERSON`( `IAMID` ) ON DELETE RESTRICT ON UPDATE RESTRICT
 );

CREATE INDEX `IAMID` ON som_01.`BANNERUSERNAME` ( `IAMID` );

CREATE TABLE som_01.`EMAIL` ( 
	`IAMID`              varchar(100)  NOT NULL    ,
	`EMAL_CODE`          varchar(16)  NOT NULL    ,
	`EMAIL_ADDRESS`      varchar(512)  NOT NULL    ,
	`STATUS_IND`         varchar(4)  NOT NULL    ,
	`PREFERRED_IND`      varchar(4)  NOT NULL    ,
	`ACTIVITY_DATE`      datetime  NOT NULL    ,
	CONSTRAINT email_ibfk_1 FOREIGN KEY ( `IAMID` ) REFERENCES som_01.`PERSON`( `IAMID` ) ON DELETE RESTRICT ON UPDATE RESTRICT
 );

CREATE INDEX `IAMID` ON som_01.`EMAIL` ( `IAMID` );

CREATE TABLE som_01.`IDMAP` ( 
	`IAMID`              varchar(100)  NOT NULL    ,
	`PIDM`               varchar(64)      ,
	`CWID`               varchar(36)      ,
	`UDCID`              varchar(64)      ,
	`USERNAME`           varchar(100)      ,
	`UNIXUID`            varchar(60)      ,
	CONSTRAINT `CWID` UNIQUE ( `CWID` ) ,
	CONSTRAINT `IAMID` UNIQUE ( `IAMID` ) ,
	CONSTRAINT `PIDM` UNIQUE ( `PIDM` ) ,
	CONSTRAINT `UDCID` UNIQUE ( `UDCID` ) ,
	CONSTRAINT `UNIXUID` UNIQUE ( `UNIXUID` ) ,
	CONSTRAINT `USERNAME` UNIQUE ( `USERNAME` ) ,
	CONSTRAINT idmap_ibfk_1 FOREIGN KEY ( `IAMID` ) REFERENCES som_01.`PERSON`( `IAMID` ) ON DELETE RESTRICT ON UPDATE RESTRICT
 );

